import React from "react";
import LikeImg from './Like.png';

const CountLikeBox = (props) => {
    return (
        <>
        <img className="Like" src={LikeImg} alt="no imag" onClick={props.addCount}></img>
        <span> {props.count} </span>
        </>
    )
}

export default CountLikeBox
